import React, { useState } from "react";
import { Link, useNavigate } from "react-router-dom";
import {
  Home,
  FileText,
  Users,
  CreditCard,
  PhoneCall,
  LogOut,
  Bell,
} from "lucide-react";
import { useAuth } from "../context/AuthContext"; // We'll create this context

const Navigation = () => {
  const { userType, logout } = useAuth();
  const navigate = useNavigate();


  const [notifications, setNotifications] = useState([]);

  const adminNavItems = [
    { icon: Home, label: "Home", path: "/" },
    { icon: FileText, label: "Projects", path: "/projects" },
    { icon: Users, label: "Team", path: "/team" },
    { icon: CreditCard, label: "Accounts", path: "/accounts" },
    { icon: PhoneCall, label: "CRM", path: "/crm" },
    // { icon: Bell, label: "Notifications" },
  ];

  const employeeNavItems = [
    { icon: Home, label: "Home", path: "/employee-home" },
  ];

  const navItems = userType === "admin" ? adminNavItems : employeeNavItems;

  const showNotifications = () => {
    console.log("Notifications");

  };

  const handleNotification = () => {
    console.log("Notification");
    setNotifications([...notifications, { id: 1, message: "Notification 1" }]);
  };

  handleNotification();

  const handleLogout = () => {
    logout();
    navigate("/login");
  };

  return (
    <div className="bg-white p-6">
      <nav className="flex justify-between items-center mb-8">
        <div className="w-40 h-12 bg-red-500 rounded-md"></div>
        <div className="flex space-x-6">
          {navItems.map((item, index) => (
            <Link
              key={index}
              to={item.path}
              className="flex items-center text-gray-600 hover:text-gray-900"
            >
              <item.icon className="w-5 h-5 mr-1" />
              <span className="text-sm">{item.label}</span>
            </Link>
          ))}
          <div className="relative">
            <button onClick={showNotifications}>
              <div>
                <Bell className="w-5 h-5 mr-1" />
              </div>
              {/* <span className="text-sm">Notifications</span> */}
            </button>
            <div className="notification-container">
              <div className="w-100 bg-grey-500 rounded-md">
                <ul className="list-none p-0 m-0 flex flex-col">

                  <li className="p-2 text-wrap">
                  Mr.Raghu has requested a project 
                  ( Lodha -2348 ) completion approval. 1{" "}
                    <span>
                      <button>
                        <svg
                          xmlns="http://www.w3.org/2000/svg"
                          fill="green"
                          viewBox="0 0 24 24"
                          stroke-width="1.5"
                          stroke="white"
                          class="size-6"
                        >
                          <path
                            stroke-linecap="round"
                            stroke-linejoin="round"
                            d="M9 12.75 11.25 15 15 9.75M21 12a9 9 0 1 1-18 0 9 9 0 0 1 18 0Z"
                          />
                        </svg>
                      </button>
                      <button>
                        <svg
                          xmlns="http://www.w3.org/2000/svg"
                          fill="red"
                          viewBox="0 0 24 24"
                          stroke-width="1.5"
                          stroke="white"
                          class="size-6"
                        >
                          <path
                            stroke-linecap="round"
                            stroke-linejoin="round"
                            d="m9.75 9.75 4.5 4.5m0-4.5-4.5 4.5M21 12a9 9 0 1 1-18 0 9 9 0 0 1 18 0Z"
                          />
                        </svg>
                      </button>
                    </span>
                  </li>
                </ul>
              </div>
            </div>
          </div>
          <button
            onClick={handleLogout}
            className="flex items-center text-gray-600 hover:text-gray-900"
          >
            <LogOut className="w-5 h-5 mr-1" />
            <span className="text-sm">Logout</span>
          </button>
        </div>
        <div className="w-12 h-12 bg-yellow-400 rounded-full"></div>
      </nav>
    </div>
  );
};

export default Navigation;
